import React, { Component } from 'react';
import YouTube from 'react-youtube';

class YouTubeComp extends Component {
    _onReady(event) {
        event.target.pauseVideo();
    }

    render() {
        const options = {
            height: '390',
            width: '640',
            playerVars: {
                autoplay: 0,
            },
        };

        return (
            <div>
                <header>
                    <p>YouTube Demo</p>
                    <input></input>
                    <button>Search</button>
                </header>
                <YouTube
                    videoId="c6t3bW7kx6E"
                    opts={options}
                    onRead={this._onReady}
                />
            </div>
        );
    }
}

export default YouTubeComp;
